import React from "react";
import Zone from "./zone";
import SchoolMap from "./SchoolMap";


class MapWindow extends React.Component {
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div className = "mapwindow">
            < SchoolMap selectedOption={this.state.selectedOption} visibility = {this.state.visibility}/>
            <div className="zonePanel">
                <div className="zoneTitle">Zone</div>
                <label class="switch">
                <input type="checkbox" id ="zonecheck" onClick={this.toggleVisibility}/>
                <span class="slider round"></span>
                </label>
            </div>
            </div>
        )
    }
}

export default MapWindow;
